> Political Scandal doesn't shake Vitter campaign in La. governor's race FILE - In this Aug. 3, 2010 file photo, Sen. David Vitter, R-La., speaks on Capitol Hill in Washington. Eight years after many thought his political career was over when news broke that his number appeared five times in the phone records of Washington's "D.C. Madam," Vitter is the front-runner among GOP gubernatorial candidates heading into an election Saturday, Oct. 24, 2015 and appears likely to reach the Nov. 21, 2015 runoff. (AP Photo/Manuel Balce Ceneta, File) 
